import { Typography } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  Label,
} from "recharts";

function getMin(data) {
  let local_min = Infinity;
  for (let i = 0; i < data.length; i++) {
    if (data[i].val < local_min) {
      local_min = data[i].val
    }
  }
  return Math.round(local_min * 0.95 / 100) * 100
}

function getMax(data) {
  let local_max = 0;
  for (let i = 0; i < data.length; i++) {
    if (data[i].val > local_max) {
      local_max = data[i].val
    }
  }
  return Math.round(local_max * 1.05 / 100) * 100
}


export default function VolumeTimeGraph(props) {
  let minRange = getMin(props.data);
  let maxRange = getMax(props.data);

  return (
    <Box sx={{ py: 5 }}>
      <Box sx={{ width: 500, marginLeft: 30 }}>
        <Typography variant="h5" align="center">
          {props.title}
        </Typography>
      </Box>
      <LineChart
        width={900}
        height={450}
        data={props.data}
        margin={{
          top: 10,
          right: 20,
          left: 20,
          bottom: 80,
        }}
      >
        <CartesianGrid strokeDasharray="1 1" />
        <XAxis 
          dataKey="date"
          angle={-45}
          dx={-25}
          dy={30}
          >
          <Label 
            position="bottom" 
            style={{ textAnchor: "middle" }}
            dy = {55}
          >
            Date
          </Label>
        </XAxis>
        <YAxis 
          unit=' mL' 
          type="number" 
          domain={[minRange, maxRange]}
          tickMargin={10}
          tickCount={10}
          width={100} 
          interval={0}
          >
          <Label angle={270} position="left" style={{ textAnchor: "middle" }}>
            Volume
          </Label>
        </YAxis>
        <Tooltip />
        <Legend />
        <Line
          type="monotone"
          dataKey="val"
          legendType="none"
          stroke="#8884d8"
          activeDot={{ r: 8 }}
        />
      </LineChart>
    </Box>
  );
}
